import "./userList.css"
import { DataGrid } from '@mui/x-data-grid';


export default function UserList() {
    const columns = [
        { field: 'id', headerName: 'ID', width: 70 },
        { field: 'username', headerName: '', width: 130 },
        { field: 'lastName', headerName: 'Last name', width: 130 },
        {
          field: 'age',
          headerName: 'Age',
          type: 'number',
          width: 90,
        },
        {
          field: 'fullName',
          headerName: 'Full name',
          description: 'This column has a value getter and is not sortable.',
          sortable: false,
          width: 160,
        //   valueGetter: (params) =>
        //     `${params.getValue(params.id, 'firstName') || ''} ${
        //       params.getValue(params.id, 'lastName') || ''
        //     }`,
        },
      ];

      const rows = [
        { id: 1, username: 'John Snow',
        avatar:"https://unsplash.com/photos/ZHvM3XIOHoE/download?force=true&w=640",
        email:"hon@gmail.com",
        status:"active",
        transaction:"120.00€",},

        { id: 2, username: 'John Snow',
        avatar:"https://unsplash.com/photos/ZHvM3XIOHoE/download?force=true&w=640",
        email:"hon@gmail.com",
        status:"active",
        transaction:"120.00€",},

        { id: 3, username: 'John Snow',
        avatar:"https://unsplash.com/photos/ZHvM3XIOHoE/download?force=true&w=640",
        email:"hon@gmail.com",
        status:"active",
        transaction:"120.00€",},

        { id: 4, username: 'John Snow',
        avatar:"https://unsplash.com/photos/ZHvM3XIOHoE/download?force=true&w=640",
        email:"hon@gmail.com",
        status:"active",
        transaction:"120.00€",},

        { id: 5, username: 'John Snow',
        avatar:"https://unsplash.com/photos/ZHvM3XIOHoE/download?force=true&w=640",
        email:"hon@gmail.com",
        status:"active",
        transaction:"120.00€",},
      ];

    return (
        <div className="userList">
            <DataGrid
        rows={rows}
        columns={columns}
        pageSize={5}
        rowsPerPageOptions={[5]}
        checkboxSelection
      />
        </div>
    )
}
